  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0081048 includes chemical,
  meteorological, physical and underway - surface data collected from Trans Future
  5 in the Bass Strait, Coral Sea, Inland Sea (Seto Naikai), North Pacific Ocean,
  Philippine Sea, Solomon Sea, South Pacific Ocean and Tasman Sea from 2006-06-27
  to 2011-08-05 and retrieved during cruise TF5-06 - TF5-51. These data include ABSOLUTE
  HUMIDITY, AIR TEMPERATURE, BAROMETRIC PRESSURE, CARBON DIOXIDE - AIR, CARBON DIOXIDE
  - PARTIAL PRESSURE - DIFFERENCE, INCOMING SOLAR RADIATION, Partial pressure (or
  fugacity) of carbon dioxide, SALINITY, SEA SURFACE TEMPERATURE, SEDIMENT PROPERTIES
  and WIND SPEED. The instruments used to collect these data include Carbon dioxide
  (CO2) gas analyzer and Shower head chamber equilibrator for autonomous carbon dioxide
  (CO2) measurement. These data were collected by Yukihiro Nojiri of National Institute
  for Environmental Studies as part of the VOS Trans Future 5 Line data set.nnThe
  Global Volunteer Observing Ship (VOS) Program is coordinated by the UNESCO International
  Ocean Carbon Coordination Project (IOCCP). International groups from 14 countries
  have been outfitting research ships and commercial vessels with automated CO2 sampling
  equipment to analyze the carbon exchange between the ocean and atmosphere.\",\n\t\"owner_org\":
